export default function about() {
  return (
    <div>
      <img src="/static/platzi-logo.png" alt="Platzi" />
      <h3>Hecho por Bau</h3>

      <style jsx>{`
        h3 {
          font-style: italic;
        }
        img {
          width: 20$;
        }
      `}</style>

      <style jsx global>{`
        body {
          background: rgb(1, 15, 95);
          display: flex;
          justify-content: center;
        }
      `}</style>
    </div>
  );
}
